import React from 'react';
import { NavLink } from 'react-router-dom';
const Navbar = ()=>{
    return (
        <>
            <div className='row'>
                <div className='col-lg-6 col-md-8 col-10'>
                    <p>
                        This is Description of the blog page assignment!
                    </p>
                </div>
            </div>
        </>
    )
}
export default Navbar
